import React from "react";

const Home = () => {
    return (
        <>
            <section id="header">
                <div className="container-fluid nav bg" >
                    <div className="row">
                        <div className="col-10 mx-auto">
                            <div className="col-md-6 pt-5 pt-lg-0 order-2 order-lg-1">
                                <h1> Grow your life, Increase your knowledge #<strong> Pankaj saini </strong> </h1>
                                
                            </div>
                        </div>
                    </div>
                </div>
            </section>
        </>
    )
}

export default Home;
